  constructor(props){
    super(props)
    this.state = {}
  }
  render(){
    return (
      <Layout>
        <style jsx>{`
          *{
            font-family: 'Arial';
            text-align: center;
          }
          .social{
            display: inline-block;
          }
          .social *{
            display: inline-block;
          }
          .social img{

          }
        `}</style>
        <h1>PDanielY</h1>
        <div className="social">

        </div>
        <p>Use the sidebar to navigate the page</p>
      </Layout>
    )
  }
}

export default HomePage
